import math

def sum_unique_primes(lst):
    primes = set()
    total_sum = 1
    for num in lst:
        if num < 2:
            continue
        is_prime = True
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                is_prime = False
                break
        if is_prime and num not in primes:
            primes.add(num)
            total_sum += num
    return total_sum

